CREATE TABLE StockTransactions (
  id bigint unsigned NOT NULL AUTO_INCREMENT,
  sourceId int unsigned NOT NULL,
  transactionCost decimal(11,2) NOT NULL,
  quantity decimal(11,2) NOT NULL,
  createdAt datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updatedAt datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  dateOfCapture datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  stockItemStockCode varchar(255) NOT NULL,
  batchId int unsigned NOT NULL,
  unitTypeId int NOT NULL,
  createdBy int NOT NULL,
  transactionOnly tinyint(1) NOT NULL DEFAULT '0',
  stockTakeId int DEFAULT NULL,
  synced tinyint(1) NOT NULL DEFAULT '0',
  effectiveTax decimal(10,2) NOT NULL DEFAULT '0.00',
  unitCost decimal(10,2) NOT NULL DEFAULT '0.00',
  sourceType enum('DELIVERY_INCREASE','PRODUCTION_INCREASE','PRODUCTION_DECREASE','TRANSFER_DECREASE','WASTE','ORDER','STOCKTAKE_DECREASE','STOCKTAKE_INCREASE','STORE_SETUP_STOCKTAKE_INCREASE','VOID_ORDER','TRANSFER_INCREASE','DELIVERY_DECREASE','STOCK_RETURN','CREDIT_NOTE_DECREASE','CREDIT_NOTE_INCREASE','REVERSE_TRANSFER_INCREASE','REVERSE_TRANSFER_DECREASE','REVERSE_WASTE','ROUNDING_ADJUSTMENT') DEFAULT NULL,
  stocktakeUnitCost decimal(11,6) DEFAULT NULL,
  linkedId bigint unsigned DEFAULT NULL,
  txCost decimal(11,3) DEFAULT '0.000',
  txQty decimal(12,3) DEFAULT '0.000',
  txUnitCost decimal(11,6) DEFAULT '0.000000',
  updatedBy int unsigned DEFAULT NULL,
  stockItemId int unsigned DEFAULT NULL,
  PRIMARY KEY (id),
  KEY stockItemStockCode (stockItemStockCode),
  KEY batchId (batchId),
  KEY unitTypeId (unitTypeId),
  KEY createdBy (createdBy),
  KEY idx_linkedId (linkedId),
  KEY idx_stockItemId (stockItemId),
  CONSTRAINT fk_stockItemId FOREIGN KEY (stockItemId) REFERENCES StockItems (id),
  CONSTRAINT fk_StockTransactions_ibfk_3 FOREIGN KEY (batchId) REFERENCES Batches (id),
  CONSTRAINT StockTransactions_ibfk_1 FOREIGN KEY (stockItemStockCode) REFERENCES StockItems (stockCode) ON UPDATE CASCADE,
  CONSTRAINT StockTransactions_ibfk_4 FOREIGN KEY (unitTypeId) REFERENCES UnitTypes (id) ON UPDATE CASCADE,
  CONSTRAINT StockTransactions_ibfk_5 FOREIGN KEY (createdBy) REFERENCES Users (id) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=122755 DEFAULT CHARSET=latin1;


